import Card from "./Background/Card";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Login from "./comp/Login";
import Register from "./comp/Register";
import MainScreen from "./comp/MessangerCom/MainScreen";
import { ContactsProvider } from "./comp/MessangerCom/Context/ContactsProvider";
import { ConversationsProvider } from "./comp/MessangerCom/Context/ConversationsProvider";
import "./index.css";
import { SocketProvider } from "./comp/MessangerCom/Context/socketProvider";
import { useLocation } from "react-router-dom";
function App() {
  const location = useLocation();

  useEffect(() => {}, [location]);
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Card></Card>
          <Login></Login>
        </Route>
        <Route path="/register">
          <Card></Card>
          <Register></Register>
        </Route>
        <Route path="/Main_Page">
          <SocketProvider>
            <ContactsProvider>
              <ConversationsProvider>
                <MainScreen />
              </ConversationsProvider>
            </ContactsProvider>
          </SocketProvider>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
